    {
        grid: {
            marginTop: '1.5rem',
            textAlign:'center'
        },
        iconTrip: {
            objectFit: 'contain',
            height: '2rem',
            width: '3rem'
        },
        title: {
            textAlign: 'center',
            color: theme.palette.neutralText.dark
        },
        subTitle: {
            color: theme.palette.neutralText.dark,
            marginTop: "1.3rem"
        }
    }
));


interface TripAdvisorProps {
}

